import React, {Component} from 'react';
import Navbar from 'react-bootstrap/Navbar';
import {Nav} from "react-bootstrap";


class Navigationbar extends Component {
    render() {
        const logoStyle = {
            color : "blue"
        };
        const textStyle = {
          fontSize : "15px",
          fontWeight : "bold"
        };
        return (
            <Navbar collapseOnSelect expand="lg" bg="dark" variant="blue">
                <Navbar.Brand fixed="" href="#home" className="ml-4 mt-1">Alper Tunca</Navbar.Brand>

                <Navbar.Collapse  className="mt-2 ml-4 justify-content-end" id="responsive-navbar-nav">
                    <Nav className="mr-auto">
                        <Nav.Link href="#home" style={textStyle}>Home</Nav.Link>
                        <Nav.Link href="#projects" style={textStyle}>Projects</Nav.Link>
                    </Nav>
                </Navbar.Collapse>

                <i className="fab fa-github-square fa-2x mr-2" aria-hidden="false" style={logoStyle}/>
                <i className="fab fa-linkedin fa-2x mr-2" aria-hidden="true"style={logoStyle} />
                <i className="fab fa-twitter-square fa-2x" style={logoStyle}/>

            </Navbar>
        );
    }
}

export default Navigationbar;
